const items = [];

for (const item of $input.all()) {
  const vulnerabilities = item.json.vulnerabilities || [];

  for (const vuln of vulnerabilities) {
    const cve = vuln.cve;
    let severity = 'UNKNOWN';
    let cvssScore = null;

    if (cve.metrics?.cvssMetricV31?.[0]) {
      const metric = cve.metrics.cvssMetricV31[0];
      severity = metric.cvssData.baseSeverity || 'UNKNOWN';
      cvssScore = metric.cvssData.baseScore;
    }

    const description = cve.descriptions?.find(d => d.lang === 'en')?.value || '';

    let vendor = null;
    let product = null;

    if (cve.configurations?.[0]?.nodes?.[0]?.cpeMatch?.[0]) {
      const cpe = cve.configurations[0].nodes[0].cpeMatch[0].criteria;
      const cpeParts = cpe.split(':');
      if (cpeParts.length >= 5) {
        vendor = cpeParts[3];
        product = cpeParts[4];
      }
    }

    items.push({
      json: {
        cve_id: cve.id,
        description: description.substring(0, 1000),
        severity: severity,
        cvss_score: cvssScore,
        vendor: vendor,
        product: product
      }
    });
  }
}

return items;

