const variant = "A_baseline";

const text = $json.output[0].content[0].text;
const parsed = JSON.parse(text || "{}");

const allCves = $node["Agg A"].json.batch_cves || [];
const selectedIds = parsed.selected_cve_ids || [];
const selected = allCves.filter(cve => selectedIds.includes(cve.cve_id));

let avgCvss = null;
if (selected.length > 0) {
  const sum = selected.reduce((acc, c) => acc + (c.cvss_score || 0), 0);
  avgCvss = sum / selected.length;
}

const riskyRegex = /(rce|remote code execution|sql injection|unauthenticated|pre-auth)/i;
let numHelm = 0;
let numRce = 0;

for (const cve of selected) {
  const desc = cve.description || "";
  const prod = ((cve.product || "") + " " + (cve.vendor || "")).toLowerCase();
  if (prod.includes("helm") || desc.toLowerCase().includes("helm")) numHelm++;
  if (riskyRegex.test(desc)) numRce++;
}

return [{
  json: {
    pipeline_variant: variant,
    risk_score: parsed.risk_score ?? null,
    avg_cvss_selected: avgCvss,
    num_selected: selected.length,
    num_helm: numHelm,
    num_rce: numRce
  }
}];

let items = $input.all();

items = items.filter(i => i.json.cvss_score != null);
items = items.filter(i => (i.json.description || "").length >= 80);
items = items.filter(i => {
  const sev = (i.json.severity || "").toUpperCase();
  return ["MEDIUM", "HIGH", "CRITICAL"].includes(sev);
});

return items;

